Actionscript.script:
if(_parent.性别 == "女")
{
	_parent.攻击呐喊();
}
else
{
	if(重劈蓄力段数 == 3)
	{_root.播放音效("青年冷峻-打斗11_01.wav");}
	else
	{_parent.攻击呐喊();}
}
_parent.UpdateSmallState("蓄力重劈释放");

if(重劈蓄力段数 == undefined)
{
	var 重劈蓄力段数 = 1;
}

子弹威力 = (_parent.空手攻击力 + _parent.刀属性.power * 4 + _parent.内力 * 3) * 重劈蓄力段数;
Z轴攻击范围 = 30;
击倒率 = 1;
水平击退速度 = 10;
兵器攻击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度);
_root.播放音效("普通刀用力竖斩.wav");

子弹威力 = (_parent.空手攻击力 + _parent.刀属性.power * 4 + _parent.内力 * 3) * 重劈蓄力段数;
Z轴攻击范围 = 30;
击倒率 = 1;
水平击退速度 = 10;
兵器攻击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度);

onClipEvent (enterFrame) {
	var 自机 = _parent._parent;
	if (自机._name == _root.控制目标)
	{
		if (自机.动作A)//J继续蓄力
		{_parent.gotoAndPlay("3蓄结束");}

		else //松开下K按键后释放
		{_parent.gotoAndPlay("重劈释放");}

		if (自机.被动技能.刀剑攻击 && 自机.被动技能.刀剑攻击.启用)
		{
			if (自机.方向 == "右")
			{// 双击右键搓招
				if (自机.doubleTapRunDirection == 1)
				{_parent.gotoAndPlay("贯穿突刺");}
			}
			else if (自机.方向 == "左")
			{// 双击左键搓招
				if (自机.doubleTapRunDirection == -1)
				{_parent.gotoAndPlay("贯穿突刺");}
			}
		}
		if (!自机.飞行浮空 && 自机.动作B)
		{自机.状态改变("兵器跳");}
	}
}

